import React from "react";
import styled from "styled-components";

const Signup = styled.form`
  display: flex;
  flex-direction: column;
  margin: auto;
  width: 50%;
`;

const Label = styled.label``;

const Input = styled.input`
  width: 100%;
`;

export const Form = () => {
  return (
    <Signup>
      <Label>
        Name
        <Input />
      </Label>
      <Label>
        E-mail
        <Input />
      </Label>
      <Label>
        Password
        <Input />
      </Label>
    </Signup>
  );
};
